    "subAreas": "<p><strong>Including:</strong></p>\n                        <ul>\n                            <li>\n                                <p>Athens on the Hill / Athens Park / Athens Village / Athens-Westmont / West Athens -\n                                    Westmont - Unincorporated</p>\n                            </li>\n                            <li>\n                                <p>Athens Park<br>\n                                    <a href=\"https://www.google.com/maps/search/?api=1&query=12603%20S%20Broadway%2C%20Los%20Angeles%2C%20CA%2090061\" target=\"_blank\" class=\"location\">\ud83d\udccd 12603 S Broadway, Los Angeles, CA 90061</a>\n                                </p>\n                            </li>\n                            <li>\n                                <p>Los Angeles Southwest College<br>\n                                    Established 1967 in the wake of the Watts riots, LASC provides affordable higher\n                                    education to South LA communities, addressing decades-long concerns over academic\n                                    access and urban-rural opportunity gaps<br>\n                                    <a href=\"https://www.google.com/maps/search/?api=1&query=1600%20W%20Imperial%20Hwy%2C%20Los%20Angeles%2C%20CA%2090047\" target=\"_blank\" class=\"location\">\ud83d\udccd 1600 W Imperial Hwy, Los Angeles, CA 90047</a>\n                                </p>\n                            </li>\n                            <li>\n                                <p>South Los Angeles Sheriff's Station<br>\n                                    <a href=\"https://www.google.com/maps/search/?api=1&query=1310%20W%20Imperial%20Hwy%2C%20Los%20Angeles%2C%20CA%2090044\" target=\"_blank\" class=\"location\">\ud83d\udccd 1310 W Imperial Hwy, Los Angeles, CA 90044</a>\n                                </p>\n                            </li>\n                        </ul>"
