    "subAreas": "<p><strong>Including:</strong></p>\n                        <ul>\n                            <li>\n                                <p>Atwater Village Branch Library<br>\n                                    <a href=\"https://www.google.com/maps/search/?api=1&query=3379%20Glendale%20Blvd%2C%20Los%20Angeles%2C%20CA%2090039\" target=\"_blank\" class=\"location\">\ud83d\udccd 3379 Glendale Blvd, Los Angeles, CA 90039</a>\n                                </p>\n                            </li>\n                            <li>\n                                <p>Glendale\u2013Hyperion Bridge:<br>\n                                    a concrete arch bridge viaduct in Atwater Village, completed in 1927, that spans the\n                                    L.A. River and Interstate 5, connecting Silver Lake to Atwater Village. It became LA\n                                    Historic-Cultural Monument 164 in 1976 and inspired a replica in Disney California\n                                    Adventure Park</p>\n                            </li>\n                        </ul>"
