    "name": "Cadillac-Corning",
    "region": "Westside",
    "description": "<h3><em>(also known as La Cienega Heights)</em></h3>\n            <p>The neighborhood originally called Cadillac\u2013Corning adopted the name La Cienega Heights in 2003. Bounded\n                by Cadillac Avenue, La Cienega Boulevard, Sawyer Street, and Robertson Boulevard, it encompasses roughly\n                10\u201318 square blocks of predominately single-family homes. Its demographic shifted from an early\n                substantial Jewish population to primarily African American and Latino residents.</p>",
