    "name": "Canoga Park",
    "region": "San Fernando Valley",
    "description": "<p><em>(formerly Owensmouth)</em><br>\n                Founded as Owensmouth on March 30, 1912, the townsite was platted at the western edge of Isaac Van\n                Nuys's wheat ranch in anticipation of water from the Owens River Aqueduct. Annexed to Los Angeles in\n                1917 to secure a municipal water supply, it was renamed Canoga Park on March 1, 1931. Today it remains a\n                largely residential San Fernando Valley neighborhood, its early Red Car and Sherman Way transit history\n                commemorated by local preservation groups.</p>",
