    "description": "<ul>\n                <li>Two Guys Plaza<br>\n                    <a href=\"https://www.google.com/maps/search/?api=1&query=1133%20Vermont%20Ave%2C%20Los%20Angeles%2C%20CA%2090006\" target=\"_blank\" class=\"location\">\ud83d\udccd 1133 Vermont Ave, Los Angeles, CA 90006</a>\n                </li>\n                <li>San Salvador Restaurant<br>\n                    <a href=\"https://www.google.com/maps/search/?api=1&query=1828%20Vermont%20Ave%2C%20Los%20Angeles%2C%20CA%2090006\" target=\"_blank\" class=\"location\">\ud83d\udccd 1828 Vermont Ave, Los Angeles, CA 90006</a>\n                </li>\n                <li>El Pulgarcito De America Restaurant<br>\n                    <a href=\"https://www.google.com/maps/search/?api=1&query=1608%20W%20Washington%20Blvd%2C%20Los%20Angeles%2C%20CA%2090007\" target=\"_blank\" class=\"location\">\ud83d\udccd 1608 W Washington Blvd, Los Angeles, CA 90007</a>\n                </li>\n                <li>El Migueleno Restaurant<br>\n                    <a href=\"https://www.google.com/maps/search/?api=1&query=2301%20S%20Vermont%20Ave%2C%20Los%20Angeles%2C%20CA%2090007\" target=\"_blank\" class=\"location\">\ud83d\udccd 2301 S Vermont Ave, Los Angeles, CA 90007</a>\n                </li>\n            </ul>\n            <ul>\n                <li>Pico-Union Historic Preservation Overlay Zone</li>\n            </ul>",
    "subAreas": "<p><strong>Including:</strong></p>\n            <ul>\n                <li>\n                    <p>Alvarado Terrace Historic District</p>\n                </li>\n                <li>\n                    <p>Byzantine-Latino Quarter (BLQ)<br>\n                        In Los Angeles, the area historically known as Greek Town is now part of the Byzantine-Latino\n                        Quarter. This area, centered around Pico and Normandie, was once a thriving hub for Greek\n                        immigrants and businesses, particularly around St. Sophia Greek Orthodox Cathedral (<span\n                            class=\"location\">\ud83d\udccd 1324 Normandie Ave, Los Angeles, CA 90006</span>). While the Greek\n                        community has largely moved out, the area retains its Greek heritage and is now home to a\n                        diverse population, including Mexican and Central American families</p>\n                </li>\n                <li>\n                    <p>El Salvador Community Corridor (Corredor salvadore\u00f1o)<br>\n                        South of Koreatown, Along S Vermont Avenue, in the 90006 and 90007 Zip Codes:</p>\n                </li>\n            </ul>"
